import React, { useState } from "react";

// Function to sanitize the pole count
const sanitizePoleCount = (value) => {
   // Handle null or undefined values

  // Log the original value to understand its structure
  console.log(`Sanitizing value: ${value}`);

  // Check for specific patterns or use a broader match
  // Example: remove "-Imported:" or other known prefixes
  let cleanedValue = value.replace(/-Imported:|[^0-9]/g, "").trim();

  // Additional checks if needed
  if (cleanedValue === "") {
    cleanedValue = "N/A";
  }

  return cleanedValue;
};


// Function to handle JSON file drop
const handleDrop = (
  event,
  setParsedData,
  setIsJsonUploaded,
  setErrorMessage
) => {
  event.preventDefault();
  const file = event.dataTransfer.files[0];
  if (file && file.type === "application/json") {
    const reader = new FileReader();
    reader.onload = (e) => {
      try {
        const json = JSON.parse(e.target.result);

        const connections = json.connections;
        const data = [];
        const errors = [];

        Object.keys(connections).forEach((key) => {
          const connection = connections[key];
          const connectionType =
            connection.attributes.connection_type?.button_added;

          if (connectionType === "aerial cable") {
            try {
              const rawPoleCount = connection.attributes.pole_count?.value;
              console.log(
                `Raw Pole Count for connection ID ${key}:`,
                rawPoleCount
              );

              // Apply the sanitization after inspecting the logged values
              const poleCount = sanitizePoleCount(rawPoleCount ?? "N/A");
              const poleTag = connection.attributes.pole_tag?.tagtext ?? "N/A";
              const constructionNotes =
                connection.attributes.construction_notes
                  ?.filter((note) => note.attacher === "Alabama Power")
                  ?.map((note) => note.note)
                  .join(", ") || "";

              data.push(
                {
                  node: connection.node_id_1,
                  poleCount,
                  poleTag,
                  constructionNotes,
                },
                {
                  node: connection.node_id_2,
                  poleCount,
                  poleTag,
                  constructionNotes,
                }
              );
            } catch (error) {
              errors.push(
                `Issue with connection.attributes for connection ID: ${key}`
              );
              console.error(`Error processing connection ID ${key}:`, error);
            }
          }
        });

        setParsedData(data);
        setErrorMessage(errors.join(" | "));
        setIsJsonUploaded(true);
      } catch (error) {
        console.error("Error parsing JSON", error);
        setErrorMessage("Error parsing JSON file.");
      }
    };
    reader.readAsText(file);
  }
};

function App() {
  const [parsedData, setParsedData] = useState([]);
  const [isJsonUploaded, setIsJsonUploaded] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");

  return (
    <div className="min-h-screen flex flex-col">
      {/* Header */}
      <header className="bg-blue-600 text-white py-4 px-8 shadow-md">
        <h1 className="text-xl font-semibold">MMU JSON Parser</h1>
      </header>

      <main className="flex-grow p-8 bg-gray-100">
        {errorMessage && (
          <div className="mb-4 p-4 bg-red-100 text-red-700 border border-red-400 rounded">
            {errorMessage}
          </div>
        )}

        {isJsonUploaded ? (
          <div className="text-gray-800">
            <h3 className="text-lg font-semibold mb-4">Aerial Cable Data:</h3>
            <div className="bg-white border border-gray-300 rounded p-4">
              <div className="grid gap-4">
                {parsedData.map((item, index) => (
                  <div key={index} className="p-2 border-b border-gray-200">
                    <p>
                      <strong>Node:</strong> {item.node}
                    </p>
                    <p>
                      <strong>Pole Count:</strong> {item.poleCount}
                    </p>
                    <p>
                      <strong>Pole Tag:</strong> {item.poleTag}
                    </p>
                    {item.constructionNotes && (
                      <p>
                        <strong>Construction Notes:</strong>{" "}
                        {item.constructionNotes}
                      </p>
                    )}
                  </div>
                ))}
              </div>
            </div>
          </div>
        ) : (
          <div
            onDragOver={(e) => e.preventDefault()}
            onDrop={(e) =>
              handleDrop(e, setParsedData, setIsJsonUploaded, setErrorMessage)
            }
            className="w-full h-48 border-4 border-dashed border-gray-300 flex items-center justify-center bg-white text-center cursor-pointer hover:border-gray-500 transition duration-300"
          >
            Drop your JSON file here
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
